public:
    sdf_3d(REAL matrix12[12], int id, int size_x, int size_y, int size_z, float grid_size, float origin_x, float origin_y, float origin_z, std::vector<float> foo){
        this->id = id;
        this->size_x = size_x;
        this->size_y = size_y;
        this->size_z = size_z;
        this->grid_size = grid_size;
        this->origin_x = origin_x;
        this->origin_y = origin_y;
        this->origin_z = origin_z;
        this->foo = foo;


        this->transf_matrix = new REAL [12];
        this->inv_transf_matrix = new REAL [12];
        for (int i=0; i<12; i++){
          this->transf_matrix[i] = matrix12[i];
        }
        invert_matrix(this->transf_matrix, this->inv_transf_matrix);


    }

    virtual void eval_implicit(const vectorized_vect& x, vectorized_scalar* f_output) const {

        vectorized_vect x_copy = x;
        matrix_vector_product(this->inv_transf_matrix, x_copy);

        int result = EM_ASM_INT({
            // console.log('Calling implicit function callback: id=', $0, "x_ptr=", $1, " count=", $2, "output_pt =", $3, " param1=", $4);
            ImplicitSdf_3d.eval_implicit($0,$1,$2,$3,$4); /* id, ptr, count, output_f_ptr*/
            // $0, Module.HEAPF.subarray($1 >> 2, ($1+$2*3)>>2), Module.HEAPF.subarray($3 >> 2, ($3+$2*3)>>2)
            return 1;
        }, id, (void*)(&((*(x.begin()))[0])), x.shape()[0], (void*)(f_output->data()), 0);
    }
    virtual void eval_gradient(const vectorized_vect& x, vectorized_vect* output) const {
    }
